import Vue from 'vue';
import App from './App.vue';

// Importation des configurations de Vuex et Vue Router
import store from './store'; // Assurez-vous que le fichier store/index.js est correctement 
configuré
import router from './router'; // Assurez-vous que le fichier router/index.js est correctement 
configuré

Vue.config.productionTip = false;

new Vue({
  router, // Utilisation de Vue Router
  store,  // Utilisation de Vuex
  render: h => h(App),
}).$mount('#app');
